import './style/App.css';


const COMMENTS = []

function GetPosts() {
  const comments = fetch('https://jsonplaceholder.typicode.com/comments/?_limit=10')
  .then((response) => response.json())
  .then((json) => {
    let comment = {
      postId: {},
      name: {},
      body: {},
      email: {},
    };
    COMMENTS.push(comment);
  })

  return (
    <table>
      <thead>
        <tr>{comments.name}</tr>
        <tr>Body</tr>
        <tr>Email</tr>
      </thead>
      <tbody>123</tbody><tbody>123</tbody><tbody>123</tbody>
    </table>
  )
}


function GetLine({ dataLine }) {
  return (
    <tr>
      <td>{dataLine.name}</td>
      <td>{dataLine.body}<br>{dataLine.email}</br></td>
    </tr>
  )
}


function GetTable({ data }) {
  GetPosts();

  return (
    <table>
      <thead>
        <th>Title</th>
        <th>Body</th>
      </thead>
      <tbody>
        <GetLine dataLine={data}/>
      </tbody>
    </table>
  )
}

export default function App() {
  return (
    <div className="App">
      <header className="App-header">
          <GetTable data={COMMENTS} />
      </header>
    </div>
  );
}
